import { Grid } from '@material-ui/core';
import React from 'react'

interface ProjectProps {
    name: string
    description: string
    link: string
}

export default function PortfolioProject(props: ProjectProps) {
    return (
        <div className="PortfolioProject">
            <Grid container spacing={3}>
                <Grid item>
                    <h4>{props.name}</h4>
                    <p>{props.description}</p>
                </Grid>

                <Grid item>
                    <img src="logo192.png" />
                </Grid>
            </Grid>
        </div>



    );
}
